proc magic_close(p:MagicPtr): void {.importc, dynlib:libName.} magic_close is a proc declared in dynlib libmagic.so and takes an argumnet p of type MagicPtr and returns void From the manpage The magic_close() function closes the magic(5) database and deallocates any resources used. #int magic_load(magic_t, const char *);
proc magic_load(p:MagicPtr, s:cstring) : cint {.importc, dynlib: libName.} magic_load is a proc declared in dynlib libmagic.so takes argument p of type MagicPtr and a cstring "compatible c string" s and returns a cint From manpage: The magic_load() function must be used to load the colon separated list of database files passed in as filename, or NULL for the default database file before any magic queries can performed. #int magic_errno(magic_t);
